35\ude10\ud835\ude2f\ud835\ude28\ud835\ude33\ud835\ude26\ud835\ude25\ud835\ude2a\ud835\ude26\ud835\ude2f\ud835\ude35\ud835\ude34:\u2063\n1/2 cup almond flour (I use @bobsredmill )\n1/2 cup oatmeal (I use @quaker )\n1/4 cup sugar (I use @lakanto ) \u2063\n1/4 cup plain non fat yogurt (can sub coconut oil)\u2063\n2 eggs\u2063\n2 tbsp runny peanut butter (I use powder and measure it pre water) I use @pbfit \u2063\n1 tsp baking powder\u2063\n1/2 tsp vanilla \u2063\nSprinkles\u2063\nChocolate bar - cut into chunks \u2063\nChocolate chips\u2063\n\u2063\n\ud835\ude0f\ud835\ude30\ud835\ude38 \ud835\ude1b\ud835\ude30:\u2063\n1. Combine dry ingredients except chocolate \u0026 sprinkles in a bowl \u0026 mix \u2063\n2. Add in the wet ingredients \u0026 mix well\u2063\n3. Once batter is formed, dump in all your sprinkles and chocolate! \u2063\n** I like using both chocolate chunks AND chips for a textural difference! \u2063\n4. Scoop batter onto a baking sheet and bake for 12 minutes at 350 degrees \u2063\n\u2063\nKeep swiping to see some an close delicious shot!#kitchensinkcookies #healthycookies #newrecipe #lowcarbrecipe"}}]},"edge_media_to_comment":{"count":58},"comments_disabled":false,"taken_at_timestamp":1620772021,"edge_liked_by":{"count":617},"edge_media_preview_like":{"count":649},"location":null,"thumbnail_src":"https://scontent-lga3-2.cdninstagram.com/v/t51.2885-15/sh0.08/e35/c0.180.1440.1440a/s640x640/184748544_1368171156883239_2076374443260939983_n.jpg?_nc_ht=scontent-lga3-2.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=BA7lTJMIqcMAX_sQpJ2\u0026tn=dWg_Hb6q7sPv0WMO\u0026edm=AAWvnRQBAAAA\u0026ccb=7-4\u0026oh=24cb84270ba28e79b52ea6258cda8a59\u0026oe=616A2F5D\u0026_nc_sid=e7738c","thumbnail_resources":[{"src":"https://scontent-lga3-2.cdninstagram.com/v/t51.2885-15/e35/c0.180.1440.1440a/s150x150/184748544_1368171156883239_2076374443260939983_n.jpg?_nc_ht=scontent-lga3-2.cdninstagram.com\u0026_nc_cat=103\u0026_nc_ohc=BA7lTJMIqcMAX_sQpJ2\u0026tn=dWg_Hb6q7sPv0WMO\u0026edm=
